                            Description = "En este puesto, como Desarrollador Backend para Broker API en SSR (Servicios de Sistemas Remotos), formarás parte de uno de los equipos de élite de IBM Consulting. Trabajarás en uno de nuestros innovadores Centros de Innovación de Clientes, los cuales son pilares esenciales para proporcionar soluciones técnicas y de la industria a una amplia gama de clientes, tanto del sector público como privado, en todo el mundo. Nuestros centros, ubicados estratégicamente, no solo son espacios de trabajo, sino también cunas de innovación donde se combinan habilidades técnicas y experiencia del cliente para impulsar la adopción de las últimas tecnologías y promover la innovación continua.\\r\\nTu rol incluirá la participación activa en el diseño, desarrollo y mantenimiento de sistemas backend críticos para nuestros clientes. Trabajarás en estrecha colaboración con equipos multifuncionales para garantizar la entrega exitosa de soluciones que cumplan con los más altos estándares de calidad y satisfagan las necesidades empresariales específicas de nuestros clientes. Utilizarás tecnologías de vanguardia y adoptarás metodologías ágiles para asegurar que los proyectos se entreguen a tiempo y dentro del presupuesto.\r\nAdemás, tendrás la oportunidad de trabajar en una variedad de proyectos desafiantes y emocionantes, desde el diseño de arquitecturas de sistemas escalables hasta la implementación de API robustas y seguras. Tu contribución será crucial para ayudar a nuestros clientes a enfrentar los desafíos tecnológicos del futuro y lograr sus objetivos empresariales.\r\nRequisitos:\r\n- Experiencia sólida en el desarrollo de sistemas backend, preferiblemente en entornos empresariales.\r\n- Conocimiento profundo de tecnologías clave, como Java, .NET, Python, o similar.\r\n- Experiencia con bases de datos relacionales y no relacionales, así como con tecnologías de almacenamiento de datos.\r\n- Habilidades demostradas en el diseño y desarrollo de API RESTful.\r\n- Familiaridad con metodologías ágiles, como Scrum o Kanban.\r\n- Excelentes habilidades de comunicación y capacidad para trabajar en equipo.\r\n- Compromiso con la excelencia técnica y la mejora continua.\r\nÚnete a nosotros en IBM Consulting y conviértete en parte de un equipo apasionado por la innovación y el éxito del cliente. Juntos, estamos impulsando la transformación digital y creando un futuro mejor para todos.\r\n¡Aplica ahora y sé parte de nuestra emocionante travesía tecnológica!\r\n",
