                            Description = "Proveer a las tiendas del material promocional de vidrieras, actas de altas y bajas y demas carteleria. \r\nRecepcionar los pedidos de insumos necesarios para las tiendas. \r\nControlar y direccionar el envio de la información a las tiendas. \r\nGestionar stock y mantenimiento de formularios de tiendas. \r\nRealizar impresión y el abastecimiento de plano gramas. \r\nEl puesto de Administrativo de Correo implica tareas administrativas fundamentales en el contexto de las operaciones de las tiendas. Desde la provisión de material promocional hasta la gestión del stock y el mantenimiento de formularios, este rol desempeña un papel crucial en garantizar la eficiencia y el flujo adecuado de información en la organización.\r\nUna de las responsabilidades clave del administrativo de correo es abastecer a las tiendas con el material promocional necesario para las vidrieras. Esto incluye la entrega de actas de altas y bajas, carteles y otros elementos visuales que contribuyen a la presentación de la tienda y promueven productos y ofertas. Además, el administrativo de correo es responsable de recibir y procesar los pedidos de insumos de las tiendas, asegurando que cuenten con los recursos necesarios para operar de manera eficiente.\r\nOtra función importante es controlar y dirigir el envío de información a las tiendas. Esto implica garantizar que la información relevante, como comunicados internos, directivas y actualizaciones de políticas, se distribuya de manera oportuna y llegue a las manos adecuadas en cada tienda. Esta tarea requiere un alto nivel de organización y atención al detalle para garantizar que la comunicación interna sea clara y efectiva.\r\nLa gestión del stock y el mantenimiento de los formularios de las tiendas también son responsabilidades clave del administrativo de correo. Esto implica realizar un seguimiento de los niveles de inventario, realizar pedidos cuando sea necesario y asegurarse de que los formularios y documentos necesarios estén disponibles en todo momento. Mantener un stock adecuado y asegurar que los formularios estén actualizados y sean accesibles es esencial para garantizar que las operaciones de la tienda se desarrollen sin problemas.\r\nAdemás de estas responsabilidades, el administrativo de correo también puede ser responsable de realizar impresiones y abastecer plano gramas. Esto puede implicar la preparación de materiales de marketing, informes internos y otros documentos impresos según sea necesario para apoyar las operaciones de la tienda y las iniciativas corporativas.\r\n",
