                            CompanyId = new Guid("09260ec0-0368-4da8-80d5-6e8b9c574920"),
                            Description = "Desarrollar Tools para CI/CD como Gitlab, Azure DEvOps o Jenkins.\r\nDesarrollar métricas DevOps, Engineering e indicadores de gestión.\r\nColaborar con equipos Cross/Funcionales para lograr delivery de productos de calidad.\r\nColaborar con implementación de buenas prácticas (CAF AWS, AZURE). La posición de Ingeniero CloudOps SR implica trabajar en estrecha colaboración con equipos multifuncionales para desarrollar y mantener la infraestructura de la nube y las operaciones de TI.\r\nEn este papel, tendrá la oportunidad de liderar y contribuir a proyectos clave que impulsan la innovación y el crecimiento empresarial. Su experiencia y habilidades serán fundamentales para el éxito de nuestro equipo y la entrega de soluciones técnicas de clase mundial a nuestros clientes.\r\nEl Ingeniero CloudOps SR es responsable de diseñar, implementar y mantener soluciones de infraestructura de nube escalables, seguras y de alto rendimiento. Trabajará en estrecha colaboración con arquitectos de soluciones, desarrolladores de software, equipos de seguridad y operaciones para garantizar la integridad y el rendimiento de nuestros sistemas en la nube.\r\nLas responsabilidades principales incluyen:\r\n- Diseñar e implementar arquitecturas de infraestructura de nube utilizando las mejores prácticas de la industria.\r\n- Desarrollar y mantener scripts de automatización para aprovisionar, configurar y gestionar recursos de nube.\r\n- Supervisar y optimizar el rendimiento de los sistemas en la nube para garantizar la disponibilidad y la capacidad de respuesta.\r\n- Colaborar con equipos multifuncionales para diseñar e implementar soluciones de seguridad de la nube que protejan los datos y los activos empresariales.\r\n- Gestionar la configuración y el cumplimiento de las políticas de seguridad y cumplimiento de la nube.\r\n- Participar en la planificación y ejecución de proyectos de migración a la nube y modernización de aplicaciones.\r\n- Investigar y evaluar nuevas tecnologías y herramientas de nube para mejorar la eficiencia y la eficacia de nuestras operaciones.\r\nEl candidato ideal para esta posición tendrá experiencia y habilidades en las siguientes áreas:\r\n- Experiencia en diseño, implementación y administración de infraestructura de nube en plataformas como AWS, Azure o Google Cloud Platform.\r\n- Conocimientos profundos de los servicios de nube como computación, almacenamiento, redes, bases de datos, seguridad y gestión.\r\n- Experiencia en scripting y automatización utilizando herramientas como PowerShell, Python, Bash o Terraform.\r\n- Conocimientos de seguridad de la nube y prácticas recomendadas, incluyendo IAM, cifrado, seguridad de red y gestión de identidades y accesos.\r\n- Habilidades de resolución de problemas y capacidad para diagnosticar y solucionar problemas de infraestructura de nube en entornos de producción.\r\n- Fuertes habilidades de comunicación y capacidad para trabajar de manera efectiva con equipos distribuidos globalmente.\r\n- Certificaciones en plataformas de nube como AWS Certified Solutions Architect, Microsoft Certified Azure Solutions Architect o Google Cloud Certified Architect son una ventaja.\r\nEn resumen, la posición de Ingeniero CloudOps SR es una oportunidad emocionante para un profesional de la tecnología apasionado por la nube y las operaciones de TI. Si está buscando un desafío gratificante en un entorno dinámico y colaborativo, ¡nos encantaría saber de usted!\r\n",
