                            Description = "Follow-up of operational excellence tools\r\nAssistance to the area of sensory and microbiology\r\nIngredient Validations\r\nMaterial life extension process\r\nPerformance measurement of packaging supplies.\r\nWe are looking for a Laboratory Intern to join our team in CPS AR. In this role, you will have the opportunity to work in a dynamic and innovative environment, supporting our laboratory operations and contributing to the development of new products and processes. As a Laboratory Intern, you will work closely with our team of scientists and engineers to conduct experiments, analyze data, and assist with day-to-day laboratory tasks. This is a great opportunity for a student or recent graduate to gain hands-on experience in a real-world laboratory setting and learn from industry experts.\r\nResponsibilities:\r\n- Follow-up of operational excellence tools to ensure compliance with quality standards.\r\n- Assistance to the area of sensory and microbiology, including sample preparation, analysis, and reporting.\r\n- Ingredient Validations: Assist with the validation of new ingredients and raw materials for use in our products.\r\n- Material life extension process: Support the team in testing and evaluating the shelf life of materials used in our packaging.\r\n- Performance measurement of packaging supplies: Help measure and analyze the performance of our packaging materials to ensure they meet our quality standards.\r\nQualifications:\r\n- Currently enrolled in a Bachelor's or Master's degree program in Food Science, Biology, Chemistry, or related field.\r\n- Strong analytical and problem-solving skills.\r\n- Excellent communication and teamwork abilities.\r\n- Ability to work independently and collaboratively in a fast-paced environment.\r\n- Experience with laboratory techniques and equipment is a plus.\r\nIf you are passionate about science and eager to gain valuable hands-on experience in a laboratory setting, we encourage you to apply for our Laboratory Intern position at CPS AR. Join us in our mission to develop innovative solutions that enhance the quality of life for people around the world.\r\n",
