                            Description = "Gestión de Materiales: Responsable de la recepción, almacenamiento y despacho de ingredientes, materiales de empaque y productos terminados. Usarás equipos como zorras, autoelevadores y/o apiladoras para mover estos materiales de manera eficiente.\r\nUso de Tecnología: Manejar el sistema WMRF (Radiofrecuencia) para el cumplimiento de los procesos de almacenamiento y abastecimiento, garantizando la precisión en el manejo de inventarios.\r\nOptimización de Procesos: Llevar a cabo tareas de Picking, Packing, control de bultos, armado de pedidos, etiquetado e identificación de materiales, asegurando la máxima eficiencia en la cadena de suministro.\r\nCalidad y Seguridad: Operar siguiendo el Sistema de Gestión Integrado, abarcando normas como OHSAS 18000, ISO 9001, FSSC 22000, ISO 14001, GMP, y HACCP, manteniendo el alto estándar de calidad y seguridad de Coca-Cola.\r\nWe are looking for a Production Operator Intern to join our team at CPS AR. In this role, you will be responsible for managing materials, using technology, optimizing processes, and ensuring quality and safety standards are met. This is a great opportunity to gain hands-on experience in a dynamic production environment and contribute to the success of our operations.\r\nResponsibilities:\r\n- Material Management: Responsible for receiving, storing, and dispatching ingredients, packaging materials, and finished products. Use equipment such as pallet jacks, forklifts, and/or stackers to move these materials efficiently.\r\n- Technology Use: Operate the WMRF (Radio Frequency) system to fulfill storage and replenishment processes, ensuring inventory handling accuracy.\r\n- Process Optimization: Perform tasks such as picking, packing, bundle control, order assembly, labeling, and material identification, ensuring maximum efficiency in the supply chain.\r\n- Quality and Safety: Operate following the Integrated Management System, covering standards such as OHSAS 18000, ISO 9001, FSSC 22000, ISO 14001, GMP, and HACCP, maintaining Coca-Cola's high quality and safety standards.\r\nQualifications:\r\n- Currently enrolled in a Bachelor's or Master's degree program in Engineering, Operations Management, Supply Chain Management, or related field.\r\n- Strong analytical and problem-solving skills.\r\n- Ability to work independently and collaboratively in a fast-paced environment.\r\n- Excellent communication and teamwork abilities.\r\n- Experience with warehouse management systems and/or inventory control software is a plus.\r\nIf you are passionate about operations and eager to gain valuable experience in a production environment, we encourage you to apply for our Production Operator Intern position at CPS AR. Join us in our mission to create refreshing moments of happiness for our consumers and make a positive impact on the world.\r\n",
