                            Description = "En esta emocionante oportunidad como Asesor Comercial de Recursos Humanos, te convertirás en un miembro valioso de nuestro equipo, desempeñando un papel fundamental en la captación comercial y el desarrollo de cuentas corporativas.\r\nTu principal responsabilidad será brindar asesoramiento de mercado y consultoría de recursos humanos a una variedad de clientes corporativos. Esto incluirá comprender la segmentación del mercado y recopilar datos de contacto de clientes potenciales y existentes para desarrollar estrategias comerciales efectivas.\r\nUna parte integral de tu función será la planificación comercial, tanto proactiva como reactiva. Esto implica realizar visitas a clientes activos y potenciales, realizar televentas, enviar mailings y sensibilizar a los clientes sobre nuestros servicios y soluciones de recursos humanos.\r\nAdemás de tus tareas comerciales, serás responsable de la selección de perfiles profesionales para los clientes asignados, asegurando que sus necesidades de contratación sean atendidas de manera efectiva y eficiente. También tendrás la oportunidad de fidelizar a los clientes asignados, garantizando que estén satisfechos con nuestros servicios y generando una relación de confianza y colaboración a largo plazo.\r\nNuestra misión es brindar la mejor experiencia posible a nuestros clientes, y como Asesor Comercial de Recursos Humanos, desempeñarás un papel crucial en la consecución de este objetivo. Tu capacidad para comprender las necesidades de los clientes, ofrecer soluciones personalizadas y establecer relaciones sólidas será fundamental para el éxito en esta función.\r\nResponsabilidades:\r\n- Captar clientes corporativos y desarrollar cuentas existentes.\r\n- Brindar asesoramiento de mercado y consultoría de recursos humanos.\r\n- Planificar y ejecutar estrategias comerciales proactivas y reactivas.\r\n- Seleccionar perfiles profesionales para clientes asignados.\r\n- Fidelizar a los clientes asignados y generar relaciones sólidas.\r\nRequisitos:\r\n- Experiencia previa en ventas, preferiblemente en el sector de recursos humanos.\r\n- Excelentes habilidades de comunicación y capacidad para establecer relaciones.\r\n- Orientación hacia resultados y capacidad para trabajar de manera autónoma.\r\n- Conocimiento del mercado laboral y tendencias en recursos humanos.\r\n- Licenciatura en Administración de Empresas, Recursos Humanos u otro campo relacionado.\r\nSi estás buscando una oportunidad emocionante en el campo de los recursos humanos y tienes pasión por las ventas y el servicio al cliente, ¡nos encantaría saber de ti! Únete a nuestro equipo y ayuda a impulsar el éxito de nuestros clientes y de nuestra empresa.\r\n",
